import React from "react";
import "./App.css";

function NavBar() {
  return (
    <nav>
      <ul>
        <li>Home</li>
        <li>Products</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
}

function ToDo() {
  const [newToDo, setNewToDo] = React.useState("");
  return (
    <>
      <form >
        <div>
          <label htmlFor="new-todo">What needs to be done?</label>
          <input
            id="new-todo"
            value={newToDo}
            onChange={(e) => setNewToDo(e.target.value)}
          />
        </div>
        <button type="submit">Add ToDo</button>
      </form>
    </>
  )
}

function Profile(props) {
  console.log(props);
  return (
    <div>
      <h2>{props.name}</h2>
      <p>{props.info}</p>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <NavBar />
      <Profile name="Ludvig" info="people pleaser"/>
      <Profile name="Sigrid" info="manipulator"/>
    </div>
  );
}

export default App;
